function getGlyphData(char) {
    const codePoint = char.codePointAt(0);
    return fontData.glyphs[codePoint] || null;
}

// Helper function to get path data by character
function getPathData(char) {
    const glyphData = getGlyphData(char);
    return glyphData ? glyphData.pathData : '';
}

